    false,nt"url": null,nt"notes": "Narrative report summarizes the results
    of coral monitoring at 11 georeferenced sites at Rose Atoll, American Samoa, undertaken
    by Dr. James Maragos, USFWS Coral Reef Biologist, between 1999 and 2012. Monitored
    parameters include generic richness, percent coral cover, mean colony diameter,
    and colony density. The summary narrative is based on graphs prepared by Dr. Maragos
    that are in turn derived from data presented in the digital file "Cnidarian Data
    at Georeferenced Sites at Rose Atoll National Wildlife Refuge", found within ServCat
    reference 29134. A coral species list is also presented.",nt"license_title":
